webpackJsonp([0x5e901e1cd9c4],{4186:function(t,e){t.exports={data:{markdownRemark:{html:'<p><a href="http://www.kentei.ne.jp/keytouch/">キータッチ2000テスト</a>と<a href="http://www.kentei.ne.jp/bus/">ビジネスキーボード認定試験</a>を受けてみた。(名前からしてなんか怪しい匂いを感じそうだが、実はこれでもちゃんとした日商の公的資格だったりする)</p>\n<ul>\n<li>キータッチ2000テスト： 2000点中1660点</li>\n<li>ビジネスキーボード認定試験 日本語 ランクA (900点中858点)</li>\n<li>同上 英語 ランクD (3000点中1308点)</li>\n<li>同上 数字 ランクD (1200点中542点)\n……あれ \'Ａ｀;？ウチ、プログラマと言う職業柄、日本語文字より英文打ち込む機会の方がはるかに多いんだけど、なんで日本語の方が成績高いんだ？てか数字と英文の成績がひどすぐる……半分すら行かないとは orz ところで、プログラマならもっとキーボード打つの早いだろｊｋってローカルの人にさんざん突っ込まれるんですが、プログラマは考え事でしょっちゅう指が止まるから遅いんよ orz むしろシスオペとかPCで事務こなしてる人の方が無茶苦茶速かったりしますよ。と苦し紛れの言い訳をしてみるテスト。 と言うかプログラマ＝長門タイピングって認識してる人の多いことｗ</li>\n</ul>',frontmatter:{cover:null,date:"2008-05-03T00:00:00+09:00",strDate:"2008/5/2",title:"キータッチ2000に挑戦してみる"}}},pathContext:{path:"/ja/blog/2008/05/03-キータッチ2000に挑戦してみる/",langKey:"ja"}}}});
